        integrity="sha384-1BmE4kWBq78iYhFldvKuhfTAU6auU8tT94WrHftjDbrCEXSU1oBoqyl2QvZ6jIW3" crossorigin="anonymous">
    <script src="https://cdn.jsdelivr.net/npm/@popperjs/core@2.10.2/dist/umd/popper.min.js"
        integrity="sha384-7+zCNj/IqJ95wo16oMtfsKbZ9ccEh31eOz1HGyDuCQ6wgnyJNSYdrPa03rtR1zdB" crossorigin="anonymous">
    </script>
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/js/bootstrap.min.js"
        integrity="sha384-QJHtvGhmr9XOIpI6YVutG+2QOK9T+ZnN4kzFN1RtK3zEFEIsxhlmWl5/YESvpZ13" crossorigin="anonymous">
    </script>

    <title>Test Docker php</title>

</head>

<body>
 
    <div class="text-center">
        <div class="row">
            <h1>Hello, Test Docker!</h1>
            <div class="col">
                <a href="info.php" target="_blank">phpinfo</a>
                <a href="http://localhost:8080/" target="_blank">adminer</a>
            </div>
            <div class="col">
                Test Docker Container for developpement
            </div>
            <div class="col">
                <button type="button" class="btn btn-primary" id="liveToastBtn">Show Password</button>
            </div>
        </div>
    </div>

    <div class="toast-container position-fixed top-10 start-50 translate-middle-x">
        <div id="liveToast" class="toast" role="alert" aria-live="assertive" aria-atomic="true">
            <div class="toast-header">
                <img src="data:image/svg+xml;base64,"
                    class="rounded me-2" alt="...">
                <strong class="me-auto">PASSWORD</strong>
                <small>1 secon ago</small>
                <button type="button" class="btn-close" data-bs-dismiss="toast" aria-label="Close"></button>
            </div>
            <div class="toast-body">
                Hello, world!<br>
                db:db <br>
                user:root <br>
                pass:secret
            </div>
        </div>
    </div>

</body>

<script>
const toastTrigger = document.getElementById('liveToastBtn')
const toastLiveExample = document.getElementById('liveToast')
if (toastTrigger) {
    toastTrigger.addEventListener('click', () => {
        const toast = new bootstrap.Toast(toastLiveExample)

        toast.show()
    })
}
</script>

</html>